import React from 'react';
import logo from './logo.svg';
import './Home.css';
import Header from '../components/Header';
import Menu from '../components/Menu';
import Card from '../components/Card';

function Home() {
    return (

        <div >

            <Header></Header>

            <div className='body'>

                <Menu/>

                <div className='cards-container'>
                    <Card/>
                </div>

            </div>

        </div>
    );
}

export default Home;
